"use strict";

function duplicateZeros(arr) {
    let n = arr.length;
    let i = -1, k = 0;
    while (k < n) {
        i++;
        k += arr[i] ? 1 : 2;
    }
    let j = n - 1;
    if (k === n + 1) {
        arr[j] = 0;
        i--;
        j--;
    }
    while (j >= 0) {
        if (arr[i] === 0) {
            arr[j] = arr[j - 1] = arr[i];
            j--;
        } else {
            arr[j] = arr[i];
        }
        i--;
        j--;
    }
}
